using System;
using System.Collections.Generic;
using System.IO;
using System.Text;

namespace testConsole
{
    public static class CreateFileHelper
    {
        public static void CreateJpgByBytes()
        {
            var base64Str = @"";
            var bits = Convert.FromBase64String(base64Str);
            var path = Environment.CurrentDirectory + "/" + "test.jpg";
            using (FileStream fs = new FileStream(path, FileMode.Create))
            {
                fs.Write(bits, 0, bits.Length);
            }
        }
    }
}
